				["quotes"] = {
					["CHAT_MSG_MONSTER_YELL"] = {
						["You have destroyed most of the fel portals, greatly hindering Rakeesh's ability to bring in reinforcements. Focus your attention on finding survivors now!"] = true,
						["Divinius, Farseer <name> has crushed the incursion. Now is the time to take the Chosen and finish off the leftover demonic taint within our halls. Secure the Exodar for our people once more!"] = true,
