					["CHAT_MSG_MONSTER_SAY"] = {
						["I will explain on the way there. Inform me when you are prepared to leave, but please hurry."] = true,
						["I know that you have ventured far to find me and have brought with you a dire message."] = true,
						["Locked away within the core is wisdom... knowledge crucial to our battle against the Burning Legion."] = true,
