						["Farewell."] = true,
						["Light damn him!"] = true,
						["I fear we have but a moment, hero. Rakeesh is still here - somewhere - and he must be stopped if my people are to find peace again."] = true,
						["We attack on your mark, <name>. Lead the charge!"] = true,
						["There is nothing left here for you, <name>."] = true,
						["I... I did... And until this moment I did not understand."] = true,
						["Fate has delivered you to us in this most dire time, hero! While I sense that your mission is urgent, if we do not push back these invading demons, we will all perish."] = true,
						["I will guide us to the heart of the vessel. Stay within my protective barrier as I cleanse the fel taint from the pathway."] = true,
						["Take Light's Heart and return to Khadgar. Tell him... Tell him that the Light died here this day."] = true,
						["In your possession is an object of great importance. May I see it?"] = true,
						["Mother of Light! I... I am sorry. I did not know."] = true,
						["Yet only a naaru born of Xe'ra is capable of unlocking the core. This is why you were sent here, <name>."] = true,
						["The last of Xe'ra's line, O'ros, sits unguarded in the heart of the Exodar. If they destroy O'ros, the information within Light's Heart will be lost forever."] = true,
						["And this is the true purpose of the Burning Legion's invasion of the Exodar."] = true,
						["Farseer <name>, we have to go. NOW!"] = true,
						["This barrier protecting my people requires all of my energy and focus. I am afraid you must venture into the demon infested halls alone. Please, search for survivors and eliminate the Legion invasion point portals that you find across the Exodar."] = true,
						["You must hurry. I do not know how much longer I can keep this barrier active!"] = true,
						["In that vision I saw myself weeping as I held a dying eredar in my arms. His skin fel-pocked and battle-scarred."] = true,
