			["121235"] = {
				["quotes"] = {
					["CHAT_MSG_MONSTER_SAY"] = {
						["Aye, sir!"] = true,
						["Ah, there's my girl. You must be restless, being cooped up here all day."] = true,
						["Don't worry about the prison break. Here in the market, you're just another traveler. Now let's get you settled in!"] = true,
						["They're a little mysterious, but they're important to Kul Tiras. They help bring fish to the nets here, and rain to the fields in the valley."] = true,
						["One way or another, we need the tidesages' help... now more than ever."] = true,
						["You'll feel at home here in no time. Now let's check in with Cyrus!"] = true,
						["I wish you could see the fleet. I think even someone as well-traveled as you would be impressed!"] = true,
						["The counting house is under heavy guard day and night. Feel free to store your valuables here."] = true,
						["Now nobody seems to know why the fleet still hasn't returned home."] = true,
						["I spend a lot of time in here, pestering travelers to tell me their stories. Especially folks from the Eastern Kingdoms!"] = true,
						["Our largest ships always carry a tidesage to navigate through storms, withstand heavy seas, and put wind in their sails."] = true,
						["Not just to bring the fleet home, but to make Kul Tiras whole again... or \"cure the infection,\" as Cyrus likes to say."] = true,
						["I'll be fine, Cyrus. I can protect myself. Besides, I have the Alliance emissary by my side!"] = true,
						["You'll need a ferry pass from the harbormaster. That won't be a problem."] = true,
						["Believe me, I know the feeling. We'll fly soon, all right?"] = true,
						["Anyway, time to put that ferry pass to good use!"] = true,
						["Most people here look to the sea for guidance the same way others look to the Light, but the tidesages, they've got a much deeper connection with the water."] = true,
						["Normally, I'd offer you a ride on Galeheart, but the tidesages only allow visitors by boat."] = true,
						["People say the tidesages have lost their magic, but I think they're just vying for power like Ashvane."] = true,
						["The market hosts travelers from all over Azeroth. There are many taverns, but this one's my favorite!"] = true,
						["This ferry connects to stations all along the sound's interior coast."] = true,
						["Beautiful, isn't she? Cyrus gave her to me when she was just a hatchling."] = true,
						["Come on! The harbormaster's office is just through here."] = true,
					},
				},
