		["quests"] = {
			[42986] = {
				["begin"] = {
					["NPC:96746"] = true,
				},
				["progress_text"] = "How are the missions going?",
				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["NPC:96746"] = true,
				},
				["reward_text"] = "Excellent work, Farseer. With events in his realm calmed, Windlord Thunderaan can focus his efforts on the war effort.",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[14104] = {
				["reward_text"] = "Ornolf's crew will want to avenge their leader, but without him, they will be easier to defeat. We must live to carry out our mission, to see Icecrown rid of the <race> and other evils.",
				["end"] = {
					["NPC:34882"] = true,
				},
			},
			[48639] = {
				["reward_text"] = "The Army of the Light thanks you.",
				["end"] = {
					["NPC:127120"] = true,
				},
			},
			[45126] = {
				["reward_text"] = "Disgusting! I can't believe I let myself fall under the spell of such a creature! \r\n\r\nI was such a fool! She made me think she really cared about me. In the end, it seems nothing I thought I knew about Agatha was true!",
				["end"] = {
					["NPC:116189"] = true,
				},
			},
			[47186] = {
				["reward_text"] = "All set?\r\n\r\nGood timing. I have your briefing ready.",
				["progress_text"] = "The Tidesages abandoned that place months ago when they pulled back to their monasteries. We still don't know why.",
				["end"] = {
					["NPC:121235"] = true,
				},
			},
			[14140] = {
				["reward_text"] = "Your actions have shown that we Sunreavers are far better allies to the Argent Crusade than the Silver Covenant and it is we who will be triumphant.",
				["end"] = {
					["NPC:34771"] = true,
				},
			},
			[29278] = {
				["reward_text"] = "Fantastic! Now ah kin get ta work.",
				["progress_text"] = "How's it going? Found any meteorites yet?",
				["end"] = {
					["NPC:53214"] = true,
				},
			},
			[51881] = {
				["reward_text"] = "A flamethrower!? This could be quite useful, but why couldn't you find one in better shape?",
				["end"] = {
					["NPC:138735"] = true,
				},
			},
			[47330] = {
				["reward_text"] = "This warning is an ill omen indeed, <name>. It seems the fate of Azeroth is tied to that of Argus, the homeworld of the Legion.\n\nWe must uncover the Dark Titan's plan! I believe the Speaker's connection to the world soul will prove crucial to our efforts.\n\nStay vigilant, Farseer. We must trust in Magni's guidance... and Azeroth's as well.",
				["end"] = {
					["NPC:90417"] = true,
				},
			},
			[60169] = {
				["reward_text"] = "It appears we are making headway.",
				["end"] = {
					["NPC:167045"] = true,
				},
			},
			[49997] = {
				["reward_text"] = "I never thought Reid would succumb to darkness. Things are worse than I feared.",
				["end"] = {
					["NPC:130714"] = true,
				},
			},
			[62293] = {
				["reward_text"] = "We prevailed against the undead before, and we shall do so again! For the Light!",
				["progress_text"] = "Scourgestones were once common amongst the minions of the Lich King. But these new ones are different... and darker.\r\n\r\nBring them to us as you find them. They will serve both a mark of your victories, and as an opportunity for us to study their strange magic.",
				["end"] = {
					["NPC:169718"] = true,
				},
			},
			[41901] = {
				["reward_text"] = "The Windlord has pledged to aid The Earthen Ring in the war against the Burning Legion?\n\nThis is fortuitous news indeed!\n\nStill, there is little time for celebration, much remains to be accomplished.",
				["end"] = {
					["NPC:96746"] = true,
				},
			},
			[44009] = {
				["reward_text"] = "Most curious indeed! This is no object of the Legion's making. Let me have a closer look.",
				["progress_text"] = "Show me what you've found.",
				["end"] = {
					["VEHICLE:112130"] = true,
				},
			},
			[50157] = {
				["begin"] = {
					["NPC:130694"] = true,
				},
				["races"] = {
					["NightElf"] = true,
				},
				["end"] = {
					["NPC:129808"] = true,
				},
				["reward_text"] = "Roz always worries about me. I keep tellin' her I'm fine up here, but she never listens...",
				["classes"] = {
					["MAGE"] = true,
				},
			},
			[45127] = {
				["reward_text"] = "So Levia is safe? That is a relief, though I wish we could have reached her sooner. An imp mother is bad enough - I can't imagine what Agatha will be capable of with Levia's power. And who knows what secrets Levia shared while under her thrall?\r\n\r\nI'm afraid that this battle may not be over yet.\r\n\r\nFor now, we should celebrate whatever victories we can get. Thank you for your assistance, <name>.",
				["end"] = {
					["NPC:90418"] = true,
				},
			},
			[50780] = {
				["reward_text"] = "I see it deemed you worthy. Good.",
				["progress_text"] = "You do have the rod, right?",
				["end"] = {
					["NPC:136497"] = true,
				},
			},
			[44153] = {
				["reward_text"] = "<A force within Light's Heart activates as you lay it down.>\n\n<You feel hopeful.>",
				["progress_text"] = "This is where you must place Light's Heart.",
				["end"] = {
					["NPC:112953"] = true,
				},
			},
			[50908] = {
