					["NPC:135682"] = true,
				},
				["races"] = {
					["NightElf"] = true,
				},
				["end"] = {
					["NPC:135682"] = true,
				},
				["reward_text"] = "With you around, they won't try this again.",
				["classes"] = {
					["MAGE"] = true,
				},
			},
			[41742] = {
				["reward_text"] = "The Windlord has commanded that I shall assist the Earthen Ring in your campaign against the Burning Legion.\n\nLord Thunderaan sees great potential in you, Farseer. As thanks for your help in securing his return as Windlord, he has granted you my services here in the mortal realm.\n\nWhen the time for battle approaches, the armies of Skywall will be at your back.",
				["end"] = {
					["NPC:106521"] = true,
				},
			},
			[48912] = {
				["reward_text"] = "A lightforged soldier can wade through a sea of demons. They will serve you well.",
				["progress_text"] = "The campaign against the Legion has taxed our existing resources heavily. Bring me supplies and I will place a lightforged under your command.\r\n\r\nI can only spare a lightforged for this few resources once per week.",
				["end"] = {
					["NPC:124312"] = true,
				},
			},
			[27051] = {
				["reward_text"] = "Thank you, undead. We will weed the rest out of their possession in time.",
				["progress_text"] = "Have you done as I've asked of you? We must weed out whatever growth agent remains within their possession.",
				["end"] = {
					["NPC:44973"] = true,
				},
			},
			[50493] = {
				["reward_text"] = "Ancel will be happy to know that Wrex is safe and sound!",
				["end"] = {
					["NPC:134447"] = true,
				},
			},
			[13809] = {
				["begin"] = {
					["NPC:33759"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:33759"] = true,
				},
				["reward_text"] = "<name>, you and your allies have spared the tournament from a devastating attack. Though our skytalon riders are brave, they  have their hands full keeping the peace on the tournament grounds and would be hard-pressed to defend the skies against the cult's attack. You have the thanks of the Argent Crusade and all who have gathered here to compete.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[60761] = {
				["reward_text"] = "I will pass this report onto the Regent Lord. I fear this is only the beginning. \r\n\r\nWord has come from Icecrown. The darkness stirs, and your strength is needed.",
				["end"] = {
					["NPC:169878"] = true,
				},
			},
			[29143] = {
				["reward_text"] = "Well done, <class>. I'll have to make more use of your skills in the future.",
