				},
			},
			[60669] = {
				["reward_text"] = "Though we must search for Thrall and Baine, we cannot neglect the protection of our citizens and allies in the process.\r\n\r\nAs such, I have enlisted the aid of those who are experienced in dealing with the Scourge.",
				["end"] = {
