				["end"] = {
					["NPC:137871"] = true,
				},
			},
			[13810] = {
				["reward_text"] = "You are a true champion, <name>, both inside the ring and on the field. We must all be vigilant against the <race> and you are a great example to our brethren and your own people.",
				["end"] = {
					["NPC:33763"] = true,
				},
			},
			[31197] = {
				["reward_text"] = "Well done, well done. That should keep us safe for a few days, at least.",
				["progress_text"] = "I don't think you're done yet.",
				["end"] = {
					["NPC:63622"] = true,
				},
			},
			[50593] = {
				["reward_text"] = "This tideblood is saturated with dark magic. Thank you for bringing it to me.",
				["progress_text"] = "What is that you have there?",
				["end"] = {
					["NPC:134639"] = true,
				},
			},
			[50609] = {
