				["end"] = {
					["NPC:33759"] = true,
				},
			},
			[47224] = {
				["reward_text"] = "I have waited many years for this day.\n\nBehold the triumph of the draenei, the Vindicaar!",
				["end"] = {
					["NPC:120977"] = true,
				},
			},
			[46729] = {
