				["end"] = {
					["NPC:121235"] = true,
				},
			},
			[52462] = {
				["reward_text"] = "And just like that, you're back in business. All the materials you put into making the item come back to you with the Scrap-O-Matic 1000.\n\nWell, maybe not ALL the materials, but hey, something's better than nothing, right?\n\nOh, and keep an eye out for expulsom. It's what we've discovered as a magical byproduct of the scrapping process.\n\nIt's quite potent and only shows up when we scrap really fancy stuff.",
				["progress_text"] = "This machine is gonna change everything!",
				["end"] = {
					["NPC:141274"] = true,
				},
			},
			[31381] = {
				["reward_text"] = "So you wish to test your skills? Very good, undead.",
				["end"] = {
					["NPC:60968"] = true,
				},
			},
			[60670] = {
