			[44004] = {
				["reward_text"] = "Kil'jaeden took the child from Velen, let Velen believe that the boy had been killed, then raised the child as an agent of the Burning Legion with the express purpose of murdering his own father? That bastard waited 13,000 years to exact vengeance upon Velen for defying Sargeras and the Legion? The Deceiver indeed...\n\nFor Velen to have to experience such tragedy after what he and his people have already been through is heartbreaking. Such a thing would test anyone's faith.",
