			[30957] = {
				["reward_text"] = "Put on our armor, and you'd be indistinguishable from any of the other sentinels out there.\n\nGood fighting, undead.",
				["end"] = {
					["NPC:61584"] = true,
				},
			},
			[31119] = {
				["reward_text"] = "Ha! Good work. Teaches both of them to make enemies of the Shado-Pan.",
				["end"] = {
					["NPC:63197"] = true,
				},
			},
			[51489] = {
				["reward_text"] = "What's going on here?!",
				["end"] = {
					["NPC:137866"] = true,
				},
			},
			[47952] = {
				["reward_text"] = "Keep your eyes open. I'm not sure we're entirely welcome.",
				["end"] = {
					["NPC:137866"] = true,
				},
			},
			[60117] = {
				["reward_text"] = "Ah, I was told to expect the arrival of a seasoned <class>.\r\n\r\nLet's get to work.",
				["end"] = {
					["NPC:166383"] = true,
				},
			},
			[46080] = {
				["reward_text"] = "We realize these spirits are misguided, but we have to care about the living more than the dead at this point.\n\nThe attacks should ease off for a while.",
				["end"] = {
					["NPC:118954"] = true,
				},
			},
			[41776] = {
				["reward_text"] = "At long last, I have returned to Skywall thanks to the help of mortal hands. I owe you a great debt, Farseer.",
				["end"] = {
					["NPC:104788"] = true,
				},
			},
			[59877] = {
				["reward_text"] = "You arrive just in time. Commander Gregor spoke highly of you.",
				["end"] = {
					["NPC:167045"] = true,
				},
			},
			[62225] = {
				["reward_text"] = "Thank the Light, you have returned unharmed!\r\n\r\nWere you able to learn anything about what the cult is doing?",
				["progress_text"] = "What have you discovered?",
				["end"] = {
					["NPC:170467"] = true,
				},
			},
			[49745] = {
				["begin"] = {
