				},
				["end"] = {
					["NPC:130694"] = true,
				},
				["reward_text"] = "The Banshee Queen is not like the previous Warchiefs.",
				["classes"] = {
					["MAGE"] = true,
				},
			},
			[50504] = {
				["reward_text"] = "I thought I was a goner for sure!",
				["end"] = {
					["NPC:134028"] = true,
				},
			},
			[49725] = {
				["reward_text"] = "Ah, Brother Alen sent you. Good.",
				["progress_text"] = "What is that pendant around your neck there?",
				["end"] = {
					["NPC:130576"] = true,
				},
			},
			[29138] = {
				["reward_text"] = "I saw several of our <class>s make it back to safety shortly after you departed. It seems your efforts were quite effective. Thank you.",
				["end"] = {
					["NPC:53080"] = true,
				},
			},
			[45916] = {
				["begin"] = {
					["NPC:116714"] = true,
				},
				["progress_text"] = "Keep these imps off me!",
				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["NPC:116714"] = true,
				},
				["reward_text"] = "The amount of power this Levia channeled into this portal is impressive, if unnecessary. Unfortunately, if we don't get it stable, it's likely to collapse and take us with it. \n\nSufficed to say, that would end your mission pretty quick.\r\n\r\nI have to concentrate to keep this open, so I'll need your help...",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[49793] = {
				["reward_text"] = "Those initiates were nowhere near ready to wield our sacred implements. They are far better served in our hands.",
				["end"] = {
					["VEHICLE:130934"] = true,
				},
			},
			[28390] = {
				["reward_text"] = "Perhaps one day, we shall slay these stone troggs more swiftly than they can breed, and in so doing, end the line of fungalmancers forever.\n\nIn time.",
				["end"] = {
					["NPC:44973"] = true,
				},
			},
			[50778] = {
				["reward_text"] = "Their rituals are growing bolder. Sooner or later they're going to summon something they can't control.",
				["end"] = {
					["NPC:136498"] = true,
				},
			},
			[51569] = {
				["progress_text"] = "We must secure our foothold on Zandalar.",
			},
			[42983] = {
				["reward_text"] = "Excellent. You have exactly the right amount of Mistral Essence necessary to restore the pillar!",
				["progress_text"] = "Were you able to collect the necessary amount?",
				["end"] = {
					["NPC:109464"] = true,
				},
			},
			[62401] = {
				["reward_text"] = "I will turn these over to the confessors immediately. There is more to these scourgestones than it seems. \r\n\r\nPerhaps they will grant us more knowledge of the creatures that assail us from the rift in the sky.\r\n\r\nIf you find any additional scourgestones while you are adventuring, please bring them to me.",
				["end"] = {
					["NPC:169718"] = true,
				},
			},
			[13846] = {
				["reward_text"] = "Thank you. I just know the crusade will put it to good use!",
				["progress_text"] = "Do you want to contribute?",
				["end"] = {
					["NPC:34210"] = true,
				},
			},
			[48636] = {
				["reward_text"] = "Another lightforged to fight alongside your forces.",
				["progress_text"] = "War is costly work. Have you gathered additional supplies for our efforts here?",
				["end"] = {
					["NPC:124312"] = true,
				},
			},
			[13811] = {
				["reward_text"] = "Well done. Training against the other champions is one of the best ways to prepare yourself for tournament competition. I know you'll make the Horde proud, <name>.",
				["progress_text"] = "Have you finished training with the other champions?",
				["end"] = {
					["NPC:33771"] = true,
				},
			},
			[60932] = {
				["reward_text"] = "It seems that eliminating the herald has slowed the Scourge's advance.\r\n\r\nWe will have to remain vigilant. Thank you for all you have done, <name>.",
				["end"] = {
					["NPC:170467"] = true,
				},
			},
			[49706] = {
				["reward_text"] = "Independence?!\n\nThis is too far. A shattered Kul Tiras will never stand!",
				["end"] = {
					["NPC:130714"] = true,
				},
			},
			[45123] = {
				["reward_text"] = "So it seems that Levia has fallen under the spell of a succubus' seduction. I fear her time alone as an outcast must have left her vulnerable to such tactics. I cannot help but feel some guilt for her turning down this path.\r\n\r\nIn any case, Levia is in great danger. She must be found!",
				["end"] = {
					["NPC:90418"] = true,
				},
			},
			[30959] = {
				["reward_text"] = "Good, you're back in one piece.\n\nWe hope to be seeing more of you in the future, undead.",
				["end"] = {
					["NPC:61581"] = true,
				},
			},
			[28692] = {
				["reward_text"] = "These parts will really help us out, <name>!  Who would have thought you can find stuff this useful in all that old junk?",
				["progress_text"] = "Did that magnet contraption actually work?",
				["end"] = {
					["NPC:48363"] = true,
				},
			},
			[50610] = {
				["reward_text"] = "Now to finish the deed.",
				["end"] = {
					["NPC:134639"] = true,
				},
			},
			[51319] = {
				["reward_text"] = "I thought this moment would never come.",
				["progress_text"] = "No matter what lies beyond that gate, we face it together.",
				["end"] = {
					["NPC:137506"] = true,
				},
			},
			[50824] = {
				["reward_text"] = "Samuel was a good man, with a true heart. A fool... but our fool.",
				["end"] = {
					["NPC:137691"] = true,
				},
			},
			[45861] = {
				["reward_text"] = "We hope the increased power to your weapon will prove useful on the Broken Shore and beyond.",
				["end"] = {
					["NPC:90418"] = true,
				},
			},
			[49887] = {
				["reward_text"] = "At least not all of the tidesages have turned on us.\n\nNot yet.",
				["end"] = {
					["NPC:130904"] = true,
				},
			},
			[42696] = {
				["reward_text"] = "Excellent work, <name>! I can see that the Hall of the Guardian is in good hands.",
				["end"] = {
					["NPC:108515"] = true,
				},
			},
			[30958] = {
				["reward_text"] = "It looks like the walls are beginning to take shape again. In time, the Temple will be whole again.",
				["end"] = {
					["NPC:61585"] = true,
				},
			},
			[46816] = {
				["reward_text"] = "Lothraxion is an old friend, and a noble warrior. We are fortunate to have him among us.",
				["end"] = {
					["NPC:120529"] = true,
				},
			},
			[42233] = {
				["reward_text"] = "The Highmountain tribes thank you.",
				["end"] = {
					["NPC:106902"] = true,
				},
			},
			[41743] = {
				["reward_text"] = "Your leadership during this time of crisis has been inspiring, Farseer <name>. It was truly an honor to journey with you through Skywall.\n\nAlthough there are many matters here that require my attention, it would be an honor to fight at your side once again.\n\nShould you have need of my aid once again, I will be yours to command.",
				["end"] = {
					["NPC:106519"] = true,
				},
			},
			[27049] = {
				["reward_text"] = "Once the growth starts, it is near impossible to stomp back into submission. Through persistence our realm will one day be cleansed.",
				["end"] = {
					["NPC:43804"] = true,
				},
			},
			[41770] = {
				["reward_text"] = "Farseer Nobundo has told me of your plan to save Azeroth. I fear I may be the only zephyr to share your desire.",
				["end"] = {
					["NPC:104797"] = true,
				},
			},
			[59878] = {
				["begin"] = {
					["NPC:167045"] = true,
				},
				["races"] = {
					["Troll"] = true,
				},
				["end"] = {
					["NPC:167045"] = true,
				},
				["reward_text"] = "A job well done, <name>. That should grant us a brief respite.",
				["classes"] = {
					["DRUID"] = true,
				},
			},
			[31043] = {
				["reward_text"] = "Well done, <name>.\n\nWe'll begin deciphering the writing on these tablets at once.",
				["progress_text"] = "Knowledge is powerful. That is why the mogu are so dangerous.",
				["end"] = {
					["NPC:62304"] = true,
				},
			},
			[60725] = {
				["reward_text"] = "The situation appears far more dire than we thought...\r\n\r\nCommander Throgg must hear of this.",
				["progress_text"] = "Reinforcements? Thank the Light!",
				["end"] = {
					["NPC:170084"] = true,
				},
			},
			[49744] = {
				["reward_text"] = "These look particularly nasty. I'm glad they aren't blowing up in our faces.",
				["progress_text"] = "Don't forget to check inside the buildings too!",
				["end"] = {
					["NPC:130190"] = true,
				},
			},
			[43002] = {
				["reward_text"] = "This blade could indeed be the key to resurrecting the Windseeker. However, it has been damaged and the elemental soul within has diminished in power.\n\nTime may very well be running out...",
				["progress_text"] = "Have you found the key to resurrecting Thunderaan?",
				["end"] = {
					["NPC:96746"] = true,
				},
			},
			[29141] = {
				["reward_text"] = "The elementals shall grow to fear you.",
				["end"] = {
					["NPC:52824"] = true,
				},
			},
			[59863] = {
				["reward_text"] = "Whoa! That was a blast, huh?",
				["progress_text"] = "How's it going?",
				["end"] = {
					["NPC:173124"] = true,
				},
			},
			[31201] = {
				["reward_text"] = "Oh, thank goodness. I was worried about them!",
