				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:52494"] = true,
				},
				["reward_text"] = "Well done, <class>. This should prove a good staging ground for pushing further into enemy territory.\n\nI sense Druids of the Flame nearby. Perhaps we shall have some sport of them as well.",
				["classes"] = {
					["WARRIOR"] = true,
				},
