				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:169928"] = true,
				},
				["reward_text"] = "This is troubling news, <name>. To think that Sylvanas would willingly ally with such a dark power...",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[28686] = {
				["reward_text"] = "Told you that village was full of wackos.  Nice job clearing it out <name>.",
				["end"] = {
					["NPC:48358"] = true,
				},
			},
			[28694] = {
