				},
				["progress_text"] = "Did the ghosts scare you off?",
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:48361"] = true,
				},
				["reward_text"] = "I didn't think you would be able to do it, <name>.  You are just full of surprises aren't you?",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[50697] = {
				["reward_text"] = "Boom!  Problem solved.",
				["end"] = {
					["NPC:134882"] = true,
				},
			},
			[30882] = {
				["reward_text"] = "Ah. The Bramblestaff family have long held the championship generation after generation. I am sure this one will take the title sooner or later as well.",
				["end"] = {
					["NPC:60968"] = true,
				},
			},
			[49998] = {
				["reward_text"] = "We must help the others before they are overrun!",
				["end"] = {
					["NPC:134639"] = true,
				},
			},
			[57249] = {
				["reward_text"] = "Welcome! It's that special time of year when the bronze dragonflight celebrates all that has happened over the years and you, <name>, are the guest of honor!\r\nCome celebrate at the grand feast, get down at the \"Disco of Time\", or accept a quest to fend off some of Azeroth's greatest threats.",
				["end"] = {
					["NPC:157113"] = true,
				},
			},
			[49755] = {
				["reward_text"] = "Those were some explosions! I'm just glad they were directed at the Horde and not us.",
				["end"] = {
					["NPC:130694"] = true,
				},
			},
			[50777] = {
				["reward_text"] = "I saw some of the defectors leaving. I'm glad we got to them before Lord Stormsong did.",
				["end"] = {
					["NPC:136498"] = true,
				},
			},
			[61488] = {
				["reward_text"] = "<A wry smile crosses the Regent Lord's face.>\r\n\r\nA fitting end to the Blightcaller. I only wish I had been there to see it.",
				["end"] = {
					["NPC:169928"] = true,
				},
			},
			[51320] = {
				["reward_text"] = "I can feel the wards' power waning even now. This is our chance to strike.",
				["end"] = {
					["NPC:137220"] = true,
				},
			},
			[29163] = {
				["reward_text"] = "Well-fought, <name>. Take a break from the flames for a while.\n\nHyjal will live to see another day, and when that day comes, I will need you alive.",
				["end"] = {
					["NPC:52669"] = true,
				},
			},
			[46082] = {
				["reward_text"] = "I had hoped this town had found peace after what we've all been through. Somehow restless dead have been stirred into a fury. We need to stop it.",
				["end"] = {
					["NPC:118947"] = true,
				},
			},
			[42170] = {
				["reward_text"] = "The Dreamweavers thank you.",
				["end"] = {
					["NPC:106901"] = true,
				},
			},
			[50595] = {
				["reward_text"] = "We're holding out alright thanks to you, but Sam is still missing!",
				["end"] = {
					["NPC:134623"] = true,
				},
			},
			[59839] = {
				["reward_text"] = "Oh boy! Did you see the look on their faces?\r\n\r\nI mean, some of them didn't really have faces, but you know... their jaws and whatnot. Hah!\r\n\r\nThat was great. The possibilities are endless!",
				["progress_text"] = "So, how's it goin'?",
				["end"] = {
					["NPC:172905"] = true,
				},
			},
			[51217] = {
				["reward_text"] = "One less Horde in Stormsong.",
				["end"] = {
					["NPC:135874"] = true,
				},
			},
			[42234] = {
				["reward_text"] = "The valarjar thank you.",
				["end"] = {
					["NPC:106904"] = true,
				},
			},
			[62262] = {
				["reward_text"] = "Oh, these are just lovely!\r\n\r\nI hope you didn't get your hands too dirty.",
				["progress_text"] = "Any luck with those samples?",
				["end"] = {
					["NPC:167572"] = true,
				},
			},
			[59783] = {
				["reward_text"] = "Why am I not surprised? You almost make it look too easy.",
				["progress_text"] = "What news have you?",
				["end"] = {
					["NPC:168880"] = true,
				},
			},
			[41771] = {
				["reward_text"] = "At long last, the Windseeker shall return to to his rightful place as heir to the Throne of Four Winds. This is a glorious day for Skywall!",
				["progress_text"] = "Have you retrieved the Heart of Skywall?",
				["end"] = {
					["NPC:113340"] = true,
				},
			},
			[31752] = {
				["reward_text"] = "I am pleased to offer this gift to you, undead <class>.  According to my calibrations, it will invoke feelings of enjoyment and gratitude.\n\nHave a nice day.",
				["end"] = {
					["NPC:43929"] = true,
				},
			},
			[29189] = {
				["reward_text"] = "Our lost allies have already made it back. They are shaken, but alive. Thank you for rescuing them.",
				["end"] = {
					["NPC:52921"] = true,
				},
			},
			[49995] = {
				["reward_text"] = "I knew they'd still have 'em! If you ever want something gone, lad you'd best destroy it yourself.",
				["progress_text"] = "Any luck recovering those blueprints?",
				["end"] = {
					["NPC:131248"] = true,
				},
			},
			[55121] = {
				["reward_text"] = "<The magic of the system appears to have been drained. Perhaps after some time has passed it can be used again.>",
				["end"] = {
					["OBJECT:322533"] = true,
				},
			},
			[50553] = {
				["reward_text"] = "Well, we had quite the adventure <name>.\r\n\r\nLet's try not to do that again anytime soon though!",
				["end"] = {
					["NPC:133204"] = true,
				},
			},
			[27353] = {
				["reward_text"] = "I have rarely had the chance to work with such exotic materials, but even I can sense the power residing within them. I will have the honor of crafting an incredible weapon for you, <name>. Mulric Boldrock did not underestimate your abilities when he told me about you.",
				["progress_text"] = "Did you bring the materials I'll need for your weapon?",
				["end"] = {
					["NPC:5511"] = true,
				},
			},
			[47589] = {
				["reward_text"] = "We may yet stand a chance.",
				["end"] = {
					["NPC:123149"] = true,
				},
			},
			[28391] = {
				["reward_text"] = "You are quite skilled at bending the dragon's will, undead. I would be jealous of your agility, except that it comes with such a fragile frame.",
				["end"] = {
					["VEHICLE:42466"] = true,
				},
			},
			[14141] = {
				["reward_text"] = "The sooner we get these stinking things out of my sight and into their cage, the faster my mood will improve. I wish the Argent Crusade had given the Silver Covenant the care of this creature. They're going to have to get their hands dirty when the battle for Icecrown Citadel starts and I have a feeling they'll prove fragile and fussy allies.",
				["end"] = {
					["NPC:34914"] = true,
				},
			},
			[31113] = {
				["begin"] = {
					["NPC:63009"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:63197"] = true,
				},
				["reward_text"] = "Well - that should certainly deter any attack for a while. Good work, <name>.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[31105] = {
				["begin"] = {
					["NPC:62304"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:62304"] = true,
				},
				["reward_text"] = "The Shan'ze are up to something. Well done, <name>, but we must continue to monitor their actions.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[50139] = {
				["reward_text"] = "A cipher? Of course! But by the great sea, what's it covered in?!",
				["progress_text"] = "We need to get to the bottom of all this before Lord Stormsong goes on the offensive!",
				["end"] = {
					["NPC:131248"] = true,
				},
			},
			[48483] = {
				["reward_text"] = "A cowled figure... and it did not attack you?\n\nMost curious.",
				["end"] = {
					["NPC:123149"] = true,
				},
